@liyuj, Hi! Thanks for the PR.

Could you add a reproducer? 

Something like a test in the `CacheDataRegionConfigurationTest` class:
```
    /** @throws Exception If failed. */
    @Test
    public void testLargeRegionsWithEviction() throws Exception {
        DataRegionConfiguration cfg1 = new DataRegionConfiguration()
            .setName("region-1")
            .setMaxSize(4 * 1024 * U.GB)
            .setPageEvictionMode(DataPageEvictionMode.RANDOM_LRU);

        DataRegionConfiguration cfg2 = new DataRegionConfiguration()
            .setName("region-2")
            .setMaxSize(4 * 1024 * U.GB)
            .setPageEvictionMode(DataPageEvictionMode.RANDOM_2_LRU);

        memCfg = new DataStorageConfiguration().setDataRegionConfigurations(cfg1, cfg2);

        startGrid();
    }
```
And then please get a visa from the CI bot. See [How to Contribute](https://cwiki.apache.org/confluence/display/IGNITE/How+to+Contribute).

public class IgniteServer {
    public static void main(String[] args) {
        IgniteConfiguration cfg = new IgniteConfiguration();
        DataStorageConfiguration storageCfg = new DataStorageConfiguration();
        DataRegionConfiguration defaultRegion = new DataRegionConfiguration();
        defaultRegion.setMaxSize(4 * 1024 * U.GB);
        defaultRegion.setPageEvictionMode(DataPageEvictionMode.RANDOM_2_LRU);
        storageCfg.setDefaultDataRegionConfiguration(defaultRegion);
        cfg.setDataStorageConfiguration(storageCfg);
        
        Ignition.start(cfg);
    }
}

above is the reproducer.
